webpackJsonp([65881560439509],{3802:function(n,t){n.exports={data:{markdownRemark:{html:'<p>どうやら本当に送信出来ているのか不安な方が多いみたいなので、ちょっとだけ解説を。</p>\n<ul>\n<li>\n<p>何か言いたいけれど<a href="https://twitter.com/danmaq">掲示板</a>に書く程でもないや的なことや、ちょっと一言意見感想などを書いて送ることが出来ます。</p>\n</li>\n<li>\n<p>操作の仕方により<em>確認画面が出ない場合がありますが、ちゃんと送れています</em>。</p>\n</li>\n<li>\n<p>もし不安でしたら、何も書かずにボタンを押してみてください。エラーが出て弾かれれば正常です。</p>\n</li>\n<li>\n<p><a href="http://www.webclap.com/">本家のweb拍手</a>と違い、メッセージなしでは拍手は送れません。</p>\n</li>\n<li>\n<p>もし長文となりそうな場合は、<a href="https://twitter.com/danmaq">掲示板</a>のご利用を強く推奨いたします。</p>\n</li>\n<li>\n<p>2006年5月8日(日)以前のメッセージは非公開と設定していましたので公開出来ません。(自動的にレスも出来ません)</p>\n</li>\n<li>\n<p>当サイトのWeb拍手もどきは<a href="http://www.webclap.com/">本家のweb拍手</a>とは一切関係ありません。</p>\n<h2>参考リンク</h2>\n</li>\n<li>\n<p><a href="http://www.webclap.com/">Web拍手</a>(本家Webサイト)</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2004-12-28T00:00:00+09:00",strDate:"2004/12/27",title:"web拍手もどきの使い方"}}},pathContext:{path:"/ja/blog/2004/12/28-web拍手もどきの使い方/",langKey:"ja"}}}});
